    "raw_sql": "SELECT\n    pri.item_code,\n    pri.item_name,\n    SUM(pri.qty) AS total_quantity,\n    SUM(pri.amount) AS total_amount,\n    DATE_FORMAT(pr.posting_date, '%Y-%m') AS purchase_month\nFROM\n    `tabPurchase Receipt Item` AS pri\nJOIN\n    `tabPurchase Receipt` AS pr ON pri.parent = pr.name\nWHERE\n    pr.docstatus = 1\nGROUP BY\n    pri.item_code, purchase_month\nORDER BY\n    purchase_month ASC, total_quantity DESC;\n",
