    "raw_sql": "SELECT\n    DATE_FORMAT(pr.posting_date, '%Y-%m') AS month,\n    pr.supplier,\n    pr.supplier_name,\n    SUM(pri.amount) AS total_purchase_amount,\n    SUM(pri.qty) AS total_quantity\nFROM\n    `tabPurchase Receipt Item` AS pri\nJOIN\n    `tabPurchase Receipt` AS pr ON pri.parent = pr.name\nWHERE\n    pr.docstatus = 1 \nGROUP BY\n    month, pr.supplier\nORDER BY\n    month DESC;\n",
